import React from 'react';
import AboutImg from "../../assets/profile1.jpg"
import CV from "../../assets/John-Cv.pdf"
import Info from './Info';
import "./about.css";

export default function About() {
  return (
    <section className="about section" id="about">
        <h2 className="section__title">Quem Sou Eu</h2>
        <span className="section__subtitle">Minha História</span>

        <div className="about__container container grid">
            <img src={AboutImg} alt="" className="about__img" />

            <div className="about__data">
                <Info/>

                <p className="about__description">
                Tenho 23 anos, sou natural de Ronda Alta - RS e moro em Chapecó. Estou cursando o 7º semestre de Ciência da Computação e sempre busco expandir meus conhecimentos na área. Participei de diversos projetos acadêmicos que fortaleceram minha formação técnica e minha capacidade de trabalhar em equipe. Sou motivado por desafios e estou sempre em busca de aprendizado e desenvolvimento profissional.
                </p>

                <a download="" href={CV} className="button button--felx">Download CV</a>
            </div>
        </div>
    </section>
  );
}
